import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";

const CourseStudents = () => {
  const { courseId } = useParams();
  const [course, setCourse] = useState(null);
  const [students, setStudents] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setIsLoading(true);

        // Fetch course details
        const courseResponse = await fetch(
          `http://localhost:5000/courses/${courseId}`
        );
        const courseData = await courseResponse.json();
        setCourse(courseData);

        // Fetch enrolled students
        const studentsResponse = await fetch(
          `http://localhost:5000/courses/${courseId}/students`
        );
        const studentsData = await studentsResponse.json();
        setStudents(studentsData);

        setIsLoading(false);
      } catch (error) {
        console.error("Error fetching data:", error);
        setIsLoading(false);
      }
    };

    fetchData();
  }, [courseId]);

  if (isLoading) {
    return (
      <div style={styles.loadingContainer}>
        <div style={styles.spinner}></div>
        <p>Loading enrolled students...</p>
      </div>
    );
  }

  if (!course) {
    return (
      <div style={styles.container}>
        <h2>Course not found</h2>
        <Link to="/courses" style={styles.backLink}>
          ← Back to Courses
        </Link>
      </div>
    );
  }

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h2 style={styles.heading}>Students Enrolled in {course.name}</h2>
        <p style={styles.subHeading}>{course.description}</p>
        <Link to="/courses" style={styles.backLink}>
          ← Back to Courses
        </Link>
      </div>

      {students.length === 0 ? (
        <div style={styles.emptyState}>
          <p style={styles.emptyText}>No students enrolled in this course</p>
        </div>
      ) : (
        <div style={styles.cardGrid}>
          {students.map((student) => (
            <div key={student._id} style={styles.card}>
              <h3 style={styles.studentName}>{student.name}</h3>
              <p style={styles.studentEmail}>{student.email}</p>
              <Link to={`/students/${student._id}`} style={styles.viewLink}>
                View student details →
              </Link>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    maxWidth: "1200px",
    margin: "0 auto",
    padding: "2rem",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  },
  header: {
    textAlign: "center",
    marginBottom: "2rem",
  },
  heading: {
    fontSize: "2rem",
    fontWeight: "600",
    color: "#2c3e50",
    marginBottom: "0.5rem",
  },
  subHeading: {
    fontSize: "1rem",
    color: "#7f8c8d",
    marginBottom: "1.5rem",
  },
  backLink: {
    color: "#3498db",
    textDecoration: "none",
    fontWeight: "500",
    marginBottom: "2rem",
    display: "inline-block",
    ":hover": {
      textDecoration: "underline",
    },
  },
  cardGrid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(300px, 1fr))",
    gap: "1.5rem",
  },
  card: {
    backgroundColor: "white",
    borderRadius: "10px",
    padding: "1.5rem",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.05)",
  },
  studentName: {
    fontSize: "1.25rem",
    fontWeight: "600",
    marginBottom: "0.5rem",
    color: "#2c3e50",
  },
  studentEmail: {
    color: "#7f8c8d",
    marginBottom: "1rem",
  },
  viewLink: {
    color: "#3498db",
    textDecoration: "none",
    ":hover": {
      textDecoration: "underline",
    },
  },
  loadingContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    height: "100vh",
  },
  spinner: {
    border: "4px solid rgba(0, 0, 0, 0.1)",
    borderLeftColor: "#3498db",
    borderRadius: "50%",
    width: "40px",
    height: "40px",
    animation: "spin 1s linear infinite",
    marginBottom: "1rem",
  },
  emptyState: {
    backgroundColor: "white",
    padding: "3rem",
    borderRadius: "10px",
    textAlign: "center",
    boxShadow: "0 2px 10px rgba(0, 0, 0, 0.05)",
  },
  emptyText: {
    fontSize: "1.25rem",
    color: "#7f8c8d",
  },
};

export default CourseStudents;
